%script

-- Click on the arrow to the right to execute this.

CREATE OR REPLACE VIEW CLAIMS0 AS SELECT * FROM ADMIN.CLAIMS0;
CREATE OR REPLACE VIEW CLAIMS AS SELECT * FROM  ADMIN.CLAIMS;

%script

-- Build Anomaly Detection Model (1-Class SVM) on CLAIMS0 data 

DECLARE
v_sql varchar2(100);

BEGIN

-- drop build settings 
BEGIN
v_sql := 'DROP TABLE CLAIMS_SET';
EXECUTE IMMEDIATE v_sql;
DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;

-- drop any previous model. 
BEGIN
v_sql := 'CALL DBMS_DATA_MINING.DROP_MODEL(''CLAIMSMODEL'')';
EXECUTE IMMEDIATE v_sql;
DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
WHEN OTHERS THEN
DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no model exists');
END;

-- Create a Build Setting table for Model Build 

EXECUTE IMMEDIATE 'CREATE TABLE CLAIMS_SET (setting_name VARCHAR2(30),setting_value VARCHAR2(4000))';
EXECUTE IMMEDIATE 'INSERT INTO CLAIMS_SET (setting_name, setting_value) VALUES (''ALGO_NAME'', ''ALGO_SUPPORT_VECTOR_MACHINES'')';
EXECUTE IMMEDIATE 'INSERT INTO CLAIMS_SET (setting_name, setting_value) VALUES (''PREP_AUTO'', ''ON'')';
DBMS_OUTPUT.PUT_LINE ('Created model build settings table: CLAIMS_SET ');

-- Build the 1-Class SVM model. 

BEGIN
   DBMS_DATA_MINING.CREATE_MODEL(
     model_name          => 'CLAIMSMODEL',
     mining_function     => dbms_data_mining.classification,
     data_table_name     => 'CLAIMS0',
     case_id_column_name => 'POLICYNUMBER',
     target_column_name  => null,
     settings_table_name => 'CLAIMS_SET');
END;

End;

